    [],nt"num_tags": 3,nt"name": "narrative-report-montezuma-national-wildlife-refuge-september-december-1951",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Montezuma National
    Wildlife Refuge outlines Refuge accomplishments from September through December
    of 1951. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, predators, rodents, raptors, and fish- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, and collections and receipts. Resource management is outlined; topics
    include grazing, fur harvesting, and timber removal. A progress report on field
    investigations and applied research is also provided. The public relations section
    of the report describes recreational uses, Refuge visitors, refuge participation,
    and violations. Items of interest and N-R forms are attached.",nt"owner_org":
